(() => {
  // js/ajax-form.js
  function objectifyFormArray(formArray) {
    var returnArray = {};
    for (var i = 0; i < formArray.length; i++) {
      returnArray[formArray[i]["name"]] = formArray[i]["value"];
    }
    return returnArray;
  }
  jQuery(document).ready(($) => {
    const contactUsForm = $("#contact-us-form");
    const contactUsFormSubmit = $("#contact-us-form #contact-us-form-submit");
    $(contactUsForm).on("submit", (e) => {
      e.preventDefault();
      $(contactUsFormSubmit).addClass("pending");
      const formDataArray = $(contactUsForm).serializeArray();
      const formData = objectifyFormArray(formDataArray);
      if (!formData.agreement)
        formData.agreement = "false";
      $.ajax({
        url: cyn_head_sceipt.url,
        type: "post",
        data: {
          action: "send_contactus_form",
          _nonce: cyn_head_sceipt.nonce,
          data: formData
        },
        success: (res) => {
          $(contactUsFormSubmit).removeClass("pending");
          $(contactUsFormSubmit).addClass("success");
          $(contactUsFormSubmit).text("Thank You, We'll Call You Soon");
          setTimeout(() => {
            $(contactUsFormSubmit).removeClass("success");
            $(contactUsFormSubmit).text("Send");
          }, 2500);
        },
        error: (err) => {
          $(contactUsFormSubmit).removeClass("pending");
          $(contactUsFormSubmit).addClass("error");
        }
      });
    });
  });

  // js/swipers.js
  if (document.getElementById("homeSwiper")) {
    document.querySelector("#homeSwiper").style.setProperty(
      "--header-width",
      document.querySelector("header").clientWidth + "px"
    );
  }
  var homeSwiper = new Swiper("#homeSwiper", {
    enabled: true,
    direction: "vertical",
    mousewheel: true,
    speed: 600
  });
  if (document.getElementById("homeSwiper")) {
    const breakpoint = window.matchMedia("(min-width:1024px)");
    if (breakpoint.matches === false) {
      homeSwiper.destroy();
      document.querySelector("#homeSwiper > .swiper-wrapper").classList.remove("swiper-wrapper");
    }
  }
  var progressCircle = document.querySelector(".autoplay-progress svg#filler");
  var homeSwiperSlider = new Swiper("#homeSwiper_slider", {
    direction: "horizontal",
    mousewheel: true,
    speed: 600,
    nested: true,
    effect: "creative",
    loop: true,
    autoplay: {
      delay: 3500,
      disableOnInteraction: false,
      stopOnLastSlide: true
    },
    creativeEffect: {
      prev: {
        shadow: true,
        translate: ["-20%", 0, -1]
      },
      next: {
        translate: ["100%", 0, 0]
      }
    },
    on: {
      autoplayTimeLeft(s, time, progress) {
        if (progress > 0) {
          progressCircle.style.setProperty("--progress", 1 - progress);
        }
      }
    },
    breakpoints: {
      1024: {
        loop: false,
        direction: "vertical",
        creativeEffect: {
          prev: {
            shadow: true,
            translate: [0, "-20%", -1]
          },
          next: {
            translate: [0, "100%", 0]
          }
        }
      }
    },
    pagination: {
      el: ".swiper-pagination",
      clickable: true
    }
  });
  var desktopBreakpoint = window.matchMedia("(min-width: 1024px)");
  var servicesSwiper = void 0;
  window.addEventListener("resize", function(e) {
    desktopBreakpoint.matches = window.matchMedia("(min-width: 1024px)").matches;
    servicesSwiperInit();
  });
  function servicesSwiperInit() {
    if (desktopBreakpoint.matches) {
      servicesSwiper = new Swiper("#homeSwiper_services", {
        direction: "horizontal",
        speed: 600,
        nested: true,
        mousewheel: true,
        spaceBetween: 40
      });
    }
    if (!desktopBreakpoint.matches) {
      const servicesSwiperWrapper = document.querySelector("#homeSwiper_services > .wrapper");
      const servicesSwiperSlide = document.querySelectorAll("#homeSwiper_services > .wrapper > .slide");
      if (servicesSwiperWrapper && servicesSwiperSlide) {
        servicesSwiperWrapper.classList.remove("swiper-wrapper");
        servicesSwiperSlide.forEach((element) => {
          element.classList.remove("swiper-slide");
        });
      }
      if (servicesSwiper) {
        servicesSwiper.destroy();
      }
    }
  }
  servicesSwiperInit();
  var promotionSwiper = new Swiper("#homeSwiper_promotion", {
    direction: "horizontal",
    speed: 600,
    nested: true,
    mousewheel: true,
    spaceBetween: 40,
    navigation: {
      nextEl: ".swiper-btn-next",
      prevEl: ".swiper-btn-prev"
    }
  });
  var productGalleryThumbs = new Swiper("#productGalleryThumbs", {
    spaceBetween: 4,
    slidesPerView: 4,
    freeMode: true,
    watchSlidesProgress: 1
  });
  var ProductGallery = new Swiper("#productGallery", {
    spaceBetween: 12,
    navigation: {
      nextEl: ".swiper-next-btn",
      prevEl: ".swiper-prev-btn"
    },
    thumbs: {
      swiper: productGalleryThumbs
    }
  });
  var productGalleryThumbsModal = new Swiper("#productGalleryThumbsModal", {
    spaceBetween: 24,
    slidesPerView: 4,
    freeMode: true,
    watchSlidesProgress: true
  });
  var productGalleryModal = new Swiper("#productGalleryModal", {
    spaceBetween: 12,
    navigation: {
      nextEl: ".btn-next",
      prevEl: ".btn-prev"
    },
    thumbs: {
      swiper: productGalleryThumbsModal
    }
  });
  var archiveProducts = new Swiper(".p-cat-swiper", {
    spaceBetween: 12,
    slidesPerView: 2,
    breakpoints: {
      1024: {
        slidesPerView: 4
      }
    }
  });
  var archiveProjectArticles = document.querySelectorAll("main.projects .archive-project-article .image-sliders .swiper-archive-project-article");
  var archiveProjectGalleres = document.querySelectorAll("main.projects .archive-project-article .image-sliders .swiper-archive-project-gallery");
  archiveProjectArticles.forEach(function(article, i) {
    const archiveProjectGallery = new Swiper(archiveProjectGalleres[i], {
      spaceBetween: 12,
      slidesPerView: 4,
      freeMode: true,
      watchSlidesProgress: true
    });
    const archiveProjectArticle = new Swiper(article, {
      slidesPerView: 1,
      spaceBetween: 12,
      centeredSlides: true,
      slideToClickedSlide: true,
      navigation: {
        nextEl: ".swiper-next-btn",
        prevEl: ".swiper-prev-btn"
      },
      thumbs: {
        swiper: archiveProjectGallery
      }
    });
  });
  var accessoriesGallery = document.querySelectorAll("main.accessories > .content > .accessory > .accessory-content > .gallery .swiper-gallery");
  var accessoriesGalleryThumbs = document.querySelectorAll("main.accessories > .content > .accessory > .accessory-content > .gallery .swiper-gallery-thumbs");
  accessoriesGallery.forEach(function(gallery, i) {
    const accessoryGalleryThumbs = new Swiper(accessoriesGalleryThumbs[i], {
      spaceBetween: 4,
      slidesPerView: 4,
      freeMode: true,
      watchSlidesProgress: 1
    });
    const accessoryGallery = new Swiper(gallery, {
      spaceBetween: 12,
      navigation: {
        nextEl: ".swiper-next-btn",
        prevEl: ".swiper-prev-btn"
      },
      thumbs: {
        swiper: accessoryGalleryThumbs
      }
    });
  });

  // js/mouse.js
  var links = document.querySelectorAll("a");
  links.forEach((link) => {
    if (!link.dataset.mouse) {
      link.dataset.mouse = link.innerText || link.innerHTML;
    }
  });
  var mouseCursor = document.querySelector(".cursor");
  var hoverElements = document.querySelectorAll("[data-mouse]");
  var hoverElementsImages = document.querySelectorAll("[data-image]");
  var copyTextElements = document.querySelectorAll('[data-mouse="copy"]');
  var nextClickElements = document.querySelectorAll('[data-mouse="next"]');
  var nextSlideSlide = document.querySelector(
    "#homeSwiper_slider .swiper-slide:nth-child(3)"
  );
  var moveCursor = (e) => {
    mouseCursor.style.top = e.pageY + "px";
    mouseCursor.style.left = e.pageX + "px";
  };
  var resetCursor = () => {
    mouseCursor.classList.remove("active");
    mouseCursor.classList.remove("active_image");
    mouseCursor.dataset.mouse = "scroll";
    mouseCursor.style.backgroundImage = "";
  };
  if (document.getElementById("homeSwiper")) {
    window.addEventListener("mousemove", moveCursor);
    homeSwiper.on("slideChange", resetCursor);
    homeSwiperSlider.on("slideChange", resetCursor);
    promotionSwiper.on("slideChange", resetCursor);
    hoverElements.forEach((elm) => {
      elm.addEventListener("mouseover", () => {
        mouseCursor.classList.add("active");
        mouseCursor.dataset.mouse = elm.dataset.mouse;
      });
      elm.addEventListener("mouseleave", () => {
        mouseCursor.classList.remove("active");
        mouseCursor.dataset.mouse = "scroll";
      });
    });
    hoverElementsImages.forEach((elm) => {
      elm.addEventListener("mouseover", () => {
        mouseCursor.classList.add("active_image");
        mouseCursor.dataset.mouse = "";
        mouseCursor.style.backgroundImage = `url('${elm.dataset.image}')`;
      });
      elm.addEventListener("mouseleave", () => {
        mouseCursor.classList.remove("active_image");
        mouseCursor.dataset.mouse = "scroll";
        mouseCursor.style.backgroundImage = "";
      });
    });
    copyTextElements.forEach((elm) => {
      elm.addEventListener("click", () => {
        navigator.clipboard.writeText(elm.innerText).then(() => {
          mouseCursor.dataset.mouse = "copied!";
        });
      });
    });
    nextSlideSlide.dataset.mouse = "let's go";
    nextSlideSlide.addEventListener("click", () => {
      homeSwiper.slideNext();
    });
    nextClickElements.forEach((el) => {
      el.addEventListener("click", () => {
        homeSwiperSlider.slideNext();
      });
    });
  }

  // js/single-product.js
  var hasSingleProduct = Boolean(document.querySelector(".single-product"));
  if (hasSingleProduct) {
    const tabs = document.querySelector(".tabs");
    const headings = tabs.querySelectorAll(".headings span");
    const contents = tabs.querySelectorAll(".content div");
    headings.forEach((headingEl) => {
      headingEl.addEventListener("click", () => {
        headings.forEach((elem) => {
          elem.classList.toggle("show", elem === headingEl);
        });
        contents.forEach((contentEl2) => {
          const shouldShow = headingEl.dataset.tab === contentEl2.dataset.tab;
          contentEl2.classList.toggle("show", shouldShow);
        });
        const contentEl = tabs.querySelector(".content");
        contentEl.style.borderTopLeftRadius = headingEl.dataset.tab !== "specification" ? "14px" : "0";
      });
    });
  }

  // js/archive-project.js
  jQuery(document).ready(function($) {
    const projectArchiveArticle = $(".archive-project-article .article-content");
    const projectArchiveGalleryCloser = $(".archive-project-article .image-sliders .icon-close");
    if (projectArchiveArticle) {
      $(projectArchiveArticle).on("click", function(e) {
        e.preventDefault();
        const parent = $(e.target).next(".image-sliders");
        $(parent).addClass("show");
      });
      $(projectArchiveGalleryCloser).on("click", function(e) {
        e.preventDefault();
        const parent = $(e.target).parents(".image-sliders");
        $(parent).removeClass("show");
      });
    }
  });

  // js/script.js
  jQuery(document).ready(function($) {
    const archiveSideBar = document.querySelector("#archiveSideBar");
    const archiveSideBarHandlers = document.querySelectorAll("#archiveSideBar .title");
    const archiveSideBarChecks = document.querySelectorAll(".inner-checkbox input[type='checkbox']");
    const archiveSideBarClear = document.querySelectorAll("#archiveSideBarClear, #archiveSideBarClearMobile");
    const archiveSideBarApply = document.querySelector("#archiveSideBarApply");
    const archiveFilterChips = document.querySelectorAll("#archive-filter-chips .icon-close");
    const archiveSideBarOpener = document.querySelectorAll("#archiveSideBarOpener, #archiveSideBarCloser, #archiveSideBarCloserMobile");
    const archiveSideBarHidden = document.querySelector("input[name='filter']");
    if (archiveSideBar) {
      const checkIsFiltered = () => {
        let isFilter = "off";
        archiveSideBarChecks.forEach((checkbox) => {
          if (checkbox.checked == true) {
            isFilter = "on";
            return;
          }
        });
        archiveSideBarHidden.value = isFilter;
      };
      const checkOpen = () => {
        archiveSideBarChecks.forEach((checkbox) => {
          if (checkbox.checked == true) {
            $(checkbox).parents(".box-container").addClass("open");
          }
        });
      };
      checkOpen();
      archiveSideBarApply.addEventListener("click", (e) => {
        e.preventDefault();
        checkIsFiltered();
        $(archiveSideBar).submit();
      });
      archiveSideBarHandlers.forEach((handler) => {
        handler.addEventListener("click", (e) => {
          e.preventDefault();
          handler.nextElementSibling.classList.toggle("open");
        });
      });
      archiveSideBarClear.forEach((clearEl) => {
        clearEl.addEventListener("click", (e) => {
          e.preventDefault();
          archiveSideBarChecks.forEach((checkbox) => {
            checkbox.checked = false;
          });
          archiveSideBarHidden.value = "off";
          $(archiveSideBar).submit();
        });
      });
      archiveSideBarOpener.forEach((btns) => {
        btns.addEventListener("click", (e) => {
          e.preventDefault();
          archiveSideBar.classList.toggle("open");
        });
      });
      archiveFilterChips.forEach((closer) => {
        closer.addEventListener("click", (e) => {
          e.preventDefault();
          const target = e.target;
          const targetCheck = document.getElementById(target.getAttribute("data-filter"));
          if (targetCheck)
            targetCheck.checked = false;
          checkIsFiltered();
          $(archiveSideBar).submit();
        });
      });
    }
  });
  jQuery(document).ready(function($) {
    const monileMenuContainer = document.getElementById("monile-menu-container");
    const mobileMenuOpener = document.getElementById("mobile-menu-opener");
    const mobileMenuCloser = document.getElementById("mobile-menu-closer");
    if (monileMenuContainer) {
      $(mobileMenuOpener).on("click", function(e) {
        e.preventDefault();
        document.body.style.overflow = "hidden";
        monileMenuContainer.classList.toggle("open");
      });
      $(mobileMenuCloser).on("click", function(e) {
        e.preventDefault();
        document.body.style.overflow = "";
        monileMenuContainer.classList.remove("open");
      });
      const subMenus = $("#monile-menu-container ul .menu-item-has-children > a");
      $(subMenus).append("<i class='icon-arrow-down-2'></i>");
      const subMenusOpener = $("#monile-menu-container ul .menu-item-has-children > a > i");
      $(subMenusOpener).on("click", function(e) {
        const target = e.target;
        const targetSub = $(target).parents("a").next(".sub-menu");
        $(targetSub).slideToggle(300, function() {
          $(targetSub).toggleClass("open");
        });
      });
    }
  });
  jQuery(document).ready(function($) {
    const dropDownOpener = document.getElementById("dropDownOpener");
    if (dropDownOpener) {
      dropDownOpener.addEventListener("click", function(e) {
        $(dropDownOpener).find(".virtual-options").toggleClass("open");
      });
    }
  });
  jQuery(document).ready(function($) {
    const inputSearch = document.querySelector("input#search");
    if (inputSearch) {
      const placeholdersTxt = [
        "Brand",
        "Type",
        "Collection",
        "Color",
        "Thickness",
        "Product",
        "Name",
        "Category"
      ];
      const txtMaxCount = placeholdersTxt.length;
      let txtCounter = 0;
      const placeholderInterval = setInterval(function() {
        if (txtCounter >= txtMaxCount)
          txtCounter = txtCounter - txtMaxCount;
        let newTxt = "Search By ";
        const newPlc = placeholdersTxt[txtCounter].split("");
        let plcCounter = 0;
        function setChar() {
          if (plcCounter < newPlc.length) {
            newTxt = newTxt + newPlc[plcCounter];
            $(inputSearch).attr("placeholder", newTxt);
            setTimeout(setChar, 120);
          }
          plcCounter++;
        }
        setChar();
        txtCounter++;
      }, 2e3);
    }
  });
  jQuery(document).ready(function($) {
    const faqItems = $("section.faq-section .faq-content .context .faq-item");
    $(faqItems).on("click", function(e) {
      const current = $(this);
      const slideItem = $(this).find(".item-content p");
      const btnItem = $(this).find(".btn");
      const allSlides = $(faqItems).find(".item-content p");
      const allBtns = $(faqItems).find(".btn");
      const duration = 300;
      if ($(current).hasClass("close")) {
        $(faqItems).removeClass("open");
        $(faqItems).addClass("close");
        $(allBtns).text("+");
        $(allSlides).slideUp(duration, function() {
        });
        $(current).removeClass("close");
        $(current).addClass("open");
        $(btnItem).text("-");
        $(slideItem).slideDown(duration, function() {
        });
      } else {
        $(current).removeClass("open");
        $(current).addClass("close");
        $(btnItem).text("+");
        $(slideItem).slideUp(duration, function() {
        });
      }
    });
  });
  jQuery(document).ready(function($) {
    const singleTheContent = $(".single-post .post-wrapper .the-content");
    const singleTableContent = $(".single-post .post-wrapper .table-of-content");
    if (singleTheContent && singleTableContent) {
      const headingTags = $(singleTheContent).children("h1, h2, h3, h4, h5, h6");
      if (headingTags.length < 1)
        return $(singleTableContent).remove();
      for (let i = 0; i < headingTags.length; i++) {
        const headingText = $(headingTags[i]).text();
        const tableUl = $(singleTableContent).children("ul");
        $(tableUl).html($(tableUl).html() + "<li><a href='#'>" + headingText + "</a></li>");
      }
      for (let i = 0; i < headingTags.length; i++) {
        const headingOffset = $(headingTags[i]).offset();
        const tableLiA = $(".table-of-content li a");
        $(tableLiA[i]).attr("href", headingOffset.top);
      }
      $(".table-of-content li a").on("click", function(e) {
        e.preventDefault();
        const offsetTop = parseInt($(e.target).attr("href"));
        $("html, body").scrollTop(offsetTop - 20);
      });
    }
  });
})();
